import datetime
from decimal import Decimal
from unittest import TestCase
from unittest.mock import Mock

import pytz as pytz
from django.core.cache import cache

from exchange.base.models import Currencies
from exchange.blockchain.api.near.near_figment import NearFigmentEnrichedAPI


class TestNearFigment(TestCase):
    near_figment = NearFigmentEnrichedAPI()
    near_figment.request = Mock()

    def test_get_balance(self):
        address = '1f921e546971e2eed170f438506069ccbc96c9a98ddf622a3ba42582f9d2464c'
        mocked_response = {'amount': '18205088987500000000000', 'locked': '0', 'code_hash': '11111111111111111111111111111111', 'storage_usage': 182, 'storage_paid_at': 0, 'block_height': 70038740, 'block_hash': 'DRzWBy1uLygza6YsqfLajNijEDvLd5UJxSMo4XfyzuZg', 'staked_amount': '0', 'staking_pools_count': 0}
        self.near_figment.request.return_value = mocked_response
        balance = self.near_figment.get_balance(address)
        assert len(list(balance)) == 1
        assert list(balance) == [Currencies.near]
        assert balance.get(Currencies.near).get('symbol') == self.near_figment.symbol
        assert balance.get(Currencies.near).get('amount') == Decimal('0.0182050889875')

        address = 'sweat_welcome.near'
        mocked_response = {'amount': '6620004233893012588793694644', 'locked': '0', 'code_hash': '11111111111111111111111111111111', 'storage_usage': 6332, 'storage_paid_at': 0, 'block_height': 70763070, 'block_hash': '8udboxYaDUkwW2sELipPGhuCcChiKGaZNHjiVEehbWXo', 'staked_amount': '0', 'staking_pools_count': 1}
        self.near_figment.request.return_value = mocked_response
        balance = self.near_figment.get_balance(address)
        assert len(list(balance)) == 1
        assert list(balance) == [Currencies.near]
        assert balance.get(Currencies.near).get('symbol') == self.near_figment.symbol
        assert balance.get(Currencies.near).get('amount') == Decimal('6620.004233893012588793694644')

    def test_get_block_head(self):
        mocked_response = {'height': 70039513, 'time': '2022-07-17T11:52:18.697935Z'}
        self.near_figment.request.return_value = mocked_response
        block_height = self.near_figment.get_block_head()
        assert block_height == 70039513

